import React from "react";
import { Text } from ".";

const Primary = ({ value, center, onClick }) => {
  return (
    <div
      className={`h-fit w-fit bg-[#3E3E3E] py-1 px-8 rounded-xl text-sm font-semi-bold select-none cursor-pointer shadow-second border-1 border-white ${
        center && "mx-auto"
      }`}
      onClick={() => onClick()}
    >
      <Text.label cursor={true} color={"white"}>
        {value}
      </Text.label>
    </div>
  );
};

const left = () => {
    
}

export { Primary };
